                for (let k = 0; k < groups.length; k++) {
                    const proposals = groups[k].proposals;

                    for (let l = 0; l < proposals.length; l++) {
                        const proposal = proposals[l];

                        // Check for Moneyline
                        if (
                            proposal.t_131_market_name === type &&
                            proposal.t_141_selection_name === name
                        ) {
                            resolve(proposal); // resolve with the matching proposal
                        }

                        // Check for Total Score
                        if (
                            proposal.t_121_event_info.includes(name) &&
                            proposal.t_131_market_name === type &&
                            proposal.t_141_selection_name.includes(ou)
                        ) {
                            resolve(proposal); // resolve with the matching proposal for Total Score
                        }
                    }
                }
            }
        }
        reject("No matching proposal found"); // reject if no matching proposal is found
    });
}

function findWinningTeams(data) {

            if (game.expected_value_colors.home_color === "GREEN") {

        for (var i in data) {
            var game = data[i];
            if (game.under_over === "UNDER") {
               game.under_over = "Over"
               totalScores.push({
                "OU": game.under_over,
                "teams": `${game.away_team} vs ${game.home_team}`
               })

                 game.under_over = "Under"
               totalScores.push({
                "OU": game.under_over,
                "teams": `${game.away_team} vs ${game.home_team}`
               })
            } else {
                console.log("Error");
            }
        }
        console.log(totalScores)
        generateOUFliff(totalScores);
    }
}
